import { Card,Button } from 'react-bootstrap';
import { GrShare } from 'react-icons/gr';



export default function CryptoCard(){
    return ( 
        <div>
            <Card >
                <div className="d-flex justify-content-between">
                    <div>
                        <h4>EUR/USD</h4>
                    </div>
                    <div>
                        <GrShare />
                    </div>
                </div>
            </Card> 
        </div>
    )
}
